import React from 'react';
import { Link } from 'react-router-dom';

const TopNav = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/">홈</Link></li>
        <li><Link to="/sleep">과잠</Link></li>
        <li><Link to="/goods">굿즈</Link></li>
        <li><Link to="/menu1">메뉴1</Link></li>
        <li><Link to="/menu2">메뉴2</Link></li>
      </ul>
    </nav>
  );
};

export default TopNav;
